import SidebarPlugin from "./SidebarPlugin/index";
import Card from "./Cards/Card.vue";
import StatsCard from "./Cards/StatsCard.vue";
import DropDown from "./Dropdown/Dropdown.vue";
let components = {
  SidebarPlugin,
  Card,
  StatsCard,
  DropDown,
};

export default components;

export {
  SidebarPlugin,
  Card,
  StatsCard,
  DropDown,
};
